    <title>ECG Data Viewer 2</title>
    <style type="text/css">
        body {
            border: 0px;
            margin: 0px;
            padding: 0px;
            background-color: #ffffff;
        }

        canvas#waveformCanvas {
            position: absolute;
            top: 40px;
            left: 0px;
            border: 10px;
            margin: 10px;
            padding: 0px;
            width: 800px;
            height: 500px;
            background-color: #484848;
        }
    </style>
</head>

    <form name="ecgView">
        <input type="button" value="Base Line" onclick="startfnc()">
        <input type="button" value="Inst" onclick="instfnc()">

        <input type="text" name="speedValue" size="20" value="Speed: 25mm/s">
        <input type="button" value="Down" onclick="speedDownfnc()">
        <input type="button" value=" UP " onclick="speedUpfnc()">

        <input type="text" name="gainValue" size="10" value="Gain: 1">
        <input type="button" value="Down" onclick="gainDownfnc()">
        <input type="button" value=" UP " onclick="gainUpfnc()">

        <input type="text" name="patientName" size="10" value="Patient A">
        <input type="button" value="Patient Name" onclick="namefnc()"><br>
    </form>

        }


        //***************************************************************************
        //
        //***************************************************************************
        function displayWaveforms() {

            for (var m = 0; m < DataCount; ++m) {

                // ***** Detects maximum and minimum data *****
                for (q = 0; q < 8; q++) {

					// ***** Inst process *****
					if(instTimer>0){
						Vnew[q] = 0;			// Inst data
					}else{
	                    Vnew[q] = gain * ecgData[NowPoint][q] / 8;		// Waveforme
					}

                    if (yMax[q] <= Vnew[q]) { yMax[q] = Vnew[q]; }
                    if (yMin[q] >= Vnew[q]) { yMin[q] = Vnew[q]; }
                }


                //***** Erase and draw waveformes *****/
                if ((Xpoint + 1) <= WaveSteps) {

                    // Draw rease line
                    if (Xpoint + 20 >= ox) {
                        i = Xpoint + 20 - ox + stdW - 1;
                    } else {
                        i = Xpoint + 20;
                    }
                    m_workDC.clearRect(i, 0, 1, oy);



                    // Draw waveforms
                    for (var q = 0; q < 8; q++) {
                        if (yMax[q] == yMin[q]) { yMax[q]++; }
                        m_workDC.beginPath();

                        // To avoid overlaped lines R and T wave. If line length is more 5dots, no pensize added
                        // Overlap waveforms to work window

                        //                      if (yMax[q] > (yMin[q] + 5)) {
                        //                           m_workDC.moveTo(Xpoint, (Voffset[q] - yMax[q]));
                        //                           m_workDC.lineTo(Xpoint, (Voffset[q] - yMin[q]));
                        //                       } else {
                        m_workDC.moveTo(Xpoint, (Voffset[q] - yMax[q] - PenSize));
                        m_workDC.lineTo(Xpoint, (Voffset[q] - yMin[q]));
                        //                       }

                        //                        m_workDC.lineCap = "round";
                        m_workDC.lineJoin = "round";
                        m_workDC.lineWidth = 1.0;
//                        m_workDC.strokeStyle = "rgb(" + String(color[q][0]) + "," + String(color[q][1]) + "," + String(color[q][2]) + ")";
                        m_workDC.strokeStyle = "rgb(0, 255, 0)";
                        m_workDC.stroke();

                        yMin[q] = Vnew[q];
                        yMax[q] = Vnew[q];

                    }

                    Xpoint += 0.1 *dSpeed / displayResolution;
                }
                WaveSteps += WaveStepsPerDot * dSpeed;

                // Set pointers to the left point of windows
                if (Xpoint > ox) {
                    WaveSteps = stdW;
                    Xpoint = stdW;
                    //               DisplayLables();
                }

                // Counts up Data pointer
                NowPoint++;									// NowPoint means it's ready for data to be written.
                if (NowPoint >= BufSize) {
                    NowPoint = 0;
                }
            }

        }

        // Pen size
        //***************************************************************************
        function startfnc() {

        //***************************************************************************
        // Inst process
        //***************************************************************************
        function instfnc() {
		if(instTimer==0){
			instTimer = 1;
			document.ecgView.moji.value = "Inst: on";
		}else{
			instTimer = 0;
			document.ecgView.moji.value = "Inst: off";
		}
        }


        //***************************************************************************
        // Speed Down and Up process
        //***************************************************************************
        function speedDownfnc() {
		dSpeed /= 2;
		if(dSpeed<0.5){
			dSpeed = 0.5;
		}
       		document.ecgView.speedValue.value = "Speed: " + String(dSpeed*25) + "mm/s";
        }

        function speedUpfnc() {
		dSpeed *= 2;
		if(dSpeed>2){
			dSpeed = 2.0;
		}
       		document.ecgView.speedValue.value = "Speed: " + String(dSpeed*25)+ "mm/s";
        }


        //***************************************************************************
        // Gain Down and Up process
        //***************************************************************************
        function gainDownfnc() {
		gain /= 2;
		if(gain<0.5){
			gain = 0.5;
		}
       		document.ecgView.gainValue.value = "Gain: " + String(gain);
        }

        function gainUpfnc() {
		gain *= 2;
		if(gain>2){
			gain = 2.0;
		}
       		document.ecgView.gainValue.value = "Gain: " + String(gain);
        }


        //***************************************************************************
        // Patient name process
        //***************************************************************************
        function namefnc() {
		switch (patient){
			case 0:
				patient += 1;
				clearInterval(timer1);
				DataCount = 7000
				WaveSteps = stdW;
				NowPoint = 0;
				Xpoint = stdW ;
				m_workDC.clearRect(0, 0, ox, oy);
				displayWaveforms();
				break;
			case 1:
				patient += 1;
				clearInterval(timer1);
				DataCount = 7000
				WaveSteps = stdW;
				NowPoint = 500;
				Xpoint = stdW ;
				m_workDC.clearRect(0, 0, ox, oy);
				displayWaveforms();
				break;
			case 2:
				patient = 0;
				DataCount = 50
				WaveSteps = stdW;
				NowPoint = 250;
				Xpoint = stdW ;
				m_workDC.clearRect(0, 0, ox, oy);
            	timer1 = setInterval("displayWaveforms()", 50);
				break;
			default:
				break;
			}
  		document.ecgView.patientName.value = "Patient " + String.fromCharCode(patient + 0x41);
        }
